import React from 'react';
import './Comp.css';

export default function Comparison() {
  return (
    <div>
      <header className="header">
        <h1>Weather Comparison</h1>
      </header>
      Place 1:
      <input
        className="place1"
        type="text"
        name="place 1"
        placeholder="Place 1"
      />
      Place 2:
      <input className="" type="text" name="place 2" placeholder="Place 2" />
      <button type="submit">Compare</button>
    </div>
  );
}
